import React, { Component } from 'react';
import Radium from 'radium';

class PageSix extends Component {

    render() {
        return (
            <div>
            <div id="ganttChart"></div>
            <br/><br/>
            <div id="eventMessage"></div>
            </div>
            )
    }
}

export default Radium(PageSix);
